import * as util from 'cytoscape/src/util';
import bfsDfs from 'cytoscape/src/collection/algorithms/bfs-dfs';
import dijkstra from 'cytoscape/src/collection/algorithms/dijkstra';
import kruskal from 'cytoscape/src/collection/algorithms/kruskal';
import aStar from 'cytoscape/src/collection/algorithms/a-star';
import floydWarshall from 'cytoscape/src/collection/algorithms/floyd-warshall';
import bellmanFord from 'cytoscape/src/collection/algorithms/bellman-ford';
import kargerStein from 'cytoscape/src/collection/algorithms/karger-stein';
import pageRank from 'cytoscape/src/collection/algorithms/page-rank';
import degreeCentrality from 'cytoscape/src/collection/algorithms/degree-centrality';
import closenessCentrality from 'cytoscape/src/collection/algorithms/closeness-centrality';
import betweennessCentrality from 'cytoscape/src/collection/algorithms/betweenness-centrality';
import markovClustering from 'cytoscape/src/collection/algorithms/markov-clustering';
import kClustering from 'cytoscape/src/collection/algorithms/k-clustering';
import hierarchicalClustering from 'cytoscape/src/collection/algorithms/hierarchical-clustering';
import affinityPropagation from 'cytoscape/src/collection/algorithms/affinity-propagation';
import hierholzer from 'cytoscape/src/collection/algorithms/hierholzer';
import hopcroftTarjanBiconnected from 'cytoscape/src/collection/algorithms/hopcroft-tarjan-biconnected';
import tarjanStronglyConnected from 'cytoscape/src/collection/algorithms/tarjan-strongly-connected';

var elesfn = {};

[
  bfsDfs,
  dijkstra,
  kruskal,
  aStar,
  floydWarshall,
  bellmanFord,
  kargerStein,
  pageRank,
  degreeCentrality,
  closenessCentrality,
  betweennessCentrality,
  markovClustering,
  kClustering,
  hierarchicalClustering,
  affinityPropagation,
  hierholzer,
  hopcroftTarjanBiconnected,
  tarjanStronglyConnected
].forEach(function(props) {
  util.extend(elesfn, props);
});

export default elesfn;
